import React from 'react';

function Fibre() {
    return (
        <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'flex-start'}}>
            <img src='desktop4.png' alt='fibre' style={{ marginRight: '7rem' }} />
            <div style={{ marginTop:'22%' }}>
                <h2 style={{ textAlign: 'left' }}>A faster way to manage <br /> your Home Fibre</h2>
                <br />
                <p style={{ textAlign: 'left' }}>
                    Manage your home fibre account on web. Check your <br />
                    balances, pay bills and so much more.
                </p>
            </div>
        </div>
    );
}

export default Fibre;
